// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmMenuItem,
  VmIcon 
} from '@vime/core';

import { define } from '../lib';


define('vm-menu-item', VmMenuItem);
define('vm-icon', VmIcon);


export interface MenuItemProps extends JSX.VmMenuItem, HTMLAttributes<HTMLVmMenuItemElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmMenuItemElement, MenuItemProps>(
  'vm-menu-item',
  new Set(['identifier','hidden','label','menu','expanded','checked','hint','badge','checkIcon','icons','isTouch']),
);
